import React from 'react';
import {View, Text, StyleSheet} from 'react-native';

export default function notifCard(props){
    const {data}=props;
    return (
        <View style={styles.card}>
            <Text style={styles.baseText}>
      I am bold
      <Text style={styles.innerText}> and red</Text>
    </Text>
        </View>
    )
}

const styles=StyleSheet.create({
    card:{
        flex:1,
        padding:10,
        elevation:1,
        borderBottomWidth:2,
        borderColor:"gray"
    },
    title:{
        flex:1,
        fontSize:18,
        fontWeight:400,
        display:"flex",
        justifyContent:"center",
    },
    description:{
        flex:1,
        fontSize:15,
        color:"gray",
        marginTop:5,
        marginBottom:5
    },
    info:{
        flex:1,
        display:"flex",
        flexDirection:"row",
        justifyContent:"flex-end"
    },
    author:{
        color:"#E77F67",
        marginRight:7
    },
    date:{
        color:"#E77F67",
        marginRight:7
    },
    view:{
        color:"#E77F67",
        marginRight:7
    },
    tag:{
        color:"#E77F67"
    },
    baseText: {
    fontWeight: 'bold'
  },
  innerText: {
    color: 'red'
  }
})
